CREATE PROCEDURE [dbo].[dsi_sp_BuildDriverTables_EFDSTKELIG]
    @SystemID char(12)
AS
SET NOCOUNT ON;
/**********************************************************************************
Client Name: Walker & Dunlop, LLC

Created By: James Bender
Business Analyst: Lea King
Create Date: 01/22/2020
Service Request Number: TekP-2019-11-14-0003

Purpose: Fidelity Stock Eligibilty Export

Revision History
----------------
Update By           Date           Request Num        Desc
XXXX                XX/XX/2020     SR-2020-000XXXXX   XXXXX

SELECT * FROM dbo.U_dsi_Configuration WHERE FormatCode = 'EFDSTKELIG';
SELECT * FROM dbo.U_dsi_SqlClauses WHERE FormatCode = 'EFDSTKELIG';
SELECT * FROM dbo.U_dsi_Parameters WHERE FormatCode = 'EFDSTKELIG';
SELECT ExpFormatCode, ExpExportCode, ExpStartPerControl, ExpEndPerControl,* FROM dbo.AscExp WHERE expFormatCode = 'EFDSTKELIG';
SELECT * FROM dbo.U_dsi_InterfaceActivityLog WHERE FormatCode = 'EFDSTKELIG' ORDER BY RunID DESC;

Execute Export
--------------
EXEC dbo.dsi_sp_TestSwitchbox_v2 'EFDSTKELIG', 'ONDEMAND';
EXEC dbo.dsi_sp_TestSwitchbox_v2 'EFDSTKELIG', 'ONDEMAND';

EXEC dbo._dsi_usp_ExportRipOut @FormatCode = 'EFDSTKELIG', @AllObjects = 'Y', @IsWeb = 'Y'
**********************************************************************************/
BEGIN

    --==========================================
    -- Declare variables
    --==========================================
    DECLARE  @FormatCode        VARCHAR(10)
            ,@ExportCode        VARCHAR(10)
            ,@StartDate         DATETIME
            ,@EndDate           DATETIME
            ,@StartPerControl   VARCHAR(9)
            ,@EndPerControl     VARCHAR(9);

    -- Set FormatCode
    SELECT @FormatCode = 'EFDSTKELIG';

    -- Declare dates from Parameter file
    SELECT
         @StartPerControl = StartPerControl
        ,@EndPerControl   = EndPerControl
        ,@StartDate       = LEFT(StartPerControl,8)
        ,@EndDate         = DATEADD(S,-1,DATEADD(D,1,LEFT(EndPerControl,8)))
        ,@ExportCode      = ExportCode
    FROM dbo.U_dsi_Parameters WITH (NOLOCK)
    WHERE FormatCode = @FormatCode;

    --==========================================
    -- Clean EE List 
    -- Caution: Careful of cleaning EE List if including paycheck data
    --==========================================

    -- Cleans EE List of terms where EE active in another company (transfer), or active in more than one company
    DELETE FROM dbo.U_EFDSTKELIG_EEList
    WHERE xCoID <> dbo.dsi_BDM_fn_GetCurrentCOID(xEEID)
    AND xEEID IN (SELECT xEEID FROM dbo.U_EFDSTKELIG_EEList GROUP BY xEEID HAVING COUNT(1) > 1);

    -- Don't use Ded Code to filter, use group
    DELETE FROM dbo.U_EFDSTKELIG_EEList
    WHERE xEEID IN (SELECT distinct EecEEID FROM EmpComp WITH (NOLOCK) WHERE EecUDField22 <> 'Y')

    -- Send terms for 60 days
    DELETE FROM dbo.U_EFDSTKELIG_EEList
    WHERE xEEID IN (    SELECT DISTINCT EecEEID 
                        FROM dbo.EmpComp WITH (NOLOCK)
                        WHERE EecEmplStatus = 'T'
                            AND EecDateOfTermination < DATEADD(DAY, -60, GETDATE()))

    -----------------------------
    -- Working Table - PEarHist
    -----------------------------
    IF OBJECT_ID('U_EFDSTKELIG_PEarHist','U') IS NOT NULL
        DROP TABLE dbo.U_EFDSTKELIG_PEarHist;
    SELECT DISTINCT
         PehEEID
        ,PrgPayDate             = MAX(PrgPayDate)
        -- Current Payroll Amount/Hours
        ,PehCurAmt              = SUM(CASE WHEN PehPerControl >= @StartPerControl THEN PehCurAmt ELSE 0.00 END)
        ,PehCurHrs              = SUM(CASE WHEN PehPerControl >= @StartPerControl THEN PehCurHrs ELSE 0.00 END)
        -- YTD Payroll Amount/Hours
        ,PehCurAmtYTD           = SUM(PehCurAmt)
        ,PehCurHrsYTD           = SUM(PehCurHrs)
        -- Current Include Deferred Comp Amount/Hours
        ,PehInclInDefComp       = SUM(CASE WHEN PehInclInDefComp = 'Y' AND PehPerControl >= @StartPerControl THEN PehCurAmt END)
        ,PehInclInDefCompHrs    = SUM(CASE WHEN PehInclInDefCompHrs = 'Y' AND PehPerControl >= @StartPerControl THEN PehCurHrs END)
        -- YTD Include Deferred Comp Amount/Hours
        ,PehInclInDefCompYTD    = SUM(CASE WHEN PehInclInDefComp = 'Y' THEN PehCurAmt END)
        ,PehInclInDefCompHrsYTD = SUM(CASE WHEN PehInclInDefCompHrs = 'Y' THEN PehCurHrs END)
        --custom fields
        ,PehSupplimentalWithholdingBaseWageAmt = SUM(CASE WHEN PehEarnCode IN ('BONUS', 'COMM', 'GTL', 'WELLN', 'CSHDV', 'SAWRD', 'LTIBN', 'MSPPM', 'MSPPV', 'PSPV', 'RSTK', 'RSTKU', 'RETBN', 'SHRDV', 'SIGNB', 'SPOTB', 'STKOP') THEN PehCurAmt END)
    INTO dbo.U_EFDSTKELIG_PEarHist
    FROM dbo.PayReg WITH (NOLOCK)
    JOIN dbo.PEarHist WITH (NOLOCK)
        ON PehGenNumber = PrgGenNumber
    WHERE LEFT(PehPerControl,4) = LEFT(@EndPerControl,4)
    AND PehPerControl <= @EndPerControl
    GROUP BY PehEEID
    HAVING SUM(PehCurAmt) <> 0.00;

    IF OBJECT_ID('dbo.U_EFDSTKELIG_ResidentYtdTaxAccumulators', 'U') IS NOT NULL
        DROP TABLE dbo.U_EFDSTKELIG_ResidentYtdTaxAccumulators;
    SELECT DISTINCT PthEEID AS YpaEEID, PthCOID AS YpaCOID
        ,SUM(PthCurTaxableWages) AS YTD2PrimaryAccumulator
    INTO dbo.U_EFDSTKELIG_ResidentYtdTaxAccumulators
    FROM dbo.PTaxHist WITH (NOLOCK)
    WHERE LEFT(PthPerControl, 4) = LEFT(@EndPerControl, 4)
        AND PthPerControl <= @EndPerControl
        AND PthTaxCode LIKE '%SIT'
        AND PthIsResidentTaxCode = 'N'
    GROUP BY PthEEID, PthCOID


    IF OBJECT_ID('U_EFDSTKELIG_YtdAccumulators', 'U') IS NOT NULL
        DROP TABLE U_EFDSTKELIG_YtdAccumulators
    SELECT DISTINCT PthEEID, PthCOID
        ,SUM(CASE WHEN PthTaxCode = 'USMEDEE' THEN PthCurTaxableWages END) as Ytd1Accumulator
        ,SUM(CASE WHEN PthTaxCode LIKE '%SIT' THEN PthCurTaxableWages END) as Ytd2Accumulator -- ... THEN THIS
    INTO dbo.U_EFDSTKELIG_YtdAccumulators
    FROM dbo.PTaxHist WITH (NOLOCK)
    JOIN dbo.TaxCode WITH (NOLOCK)
        ON PthTaxCode = CtcTaxCode
    WHERE LEFT(PthPerControl,4) = LEFT(@EndPerControl,4)
        AND PthPerControl <= @EndPerControl
    GROUP BY PthEEID, PthCOID

    --==========================================
    -- Build Driver Tables
    --==========================================
    ---------------------------------
    -- DETAIL RECORD - U_EFDSTKELIG_drvTbl
    ---------------------------------
    IF OBJECT_ID('U_EFDSTKELIG_drvTbl','U') IS NOT NULL
        DROP TABLE dbo.U_EFDSTKELIG_drvTbl;
    SELECT DISTINCT
         drvEEID = xEEID
        ,drvCoID = xCoID
        ,drvDepRecID = CONVERT(varchar(12),'1') --DELETE IF NOT USING DEPENDENT DATA
        ,drvSort = EecEmplStatus
        -- standard fields above and additional driver fields below
        ,drvSSN = LEFT(eepSSN, 3) + '-' + RIGHT(LEFT(eepSSN,5),2) + '-' + LEFT(RIGHT(EepSSN, 6),4)
        ,drvEmpId = EecEmpNo
        ,drvNameLast = EepNameLast
        ,drvNameFirst = EepNameFirst + ' ' + LEFT(ISNULL(EepNameMiddle,''),1)
        ,drvNameMiddleInit = '' --LEFT(EepNameMiddle,1)
        ,drvEmailAddress = EepAddressEMail
        ,drvAddressLine1 = EepAddressLine1
        ,drvAddressLine2 = EepAddressLine2
        ,drvAddressCity = EepAddressCity
        ,drvAddressState = EepAddressState
        ,drvAddressZipCode = EepAddressZipCode
        ,drvTitleCode = LEFT(OrgDesc, 2)
        ,drvDateOfBirth = EepDateOfBirth
        ,drvDateOfHire = EecDateOfOriginalHire
        ,drvDateOfReHire = CASE WHEN EecEmplStatus IN ('A', 'L') and EecDateOfOriginalHire <> EecDateOfLastHire THEN EecDateOfLastHire END
        ,drvTermCode =    CASE WHEN eecEmplStatus = 'T' THEN
                            CASE EecTermReason 
                                WHEN '203' THEN 'DEATH'
                                WHEN '202' THEN 'RETIRED'
                                WHEN '210' THEN 'DISABLED'
                                WHEN '901' THEN 'CAUSE'
                                ELSE 'TERMED'
                            END
                        END
        ,drvTermDate = CASE WHEN EecEmplStatus = 'T' THEN EecDateOfTermination END
        ,drvBrokerCode = LEFT(LocDesc, 2)
        ,drvTaxYear = CAST(YEAR(GETDATE()) as VARCHAR)
        ,drvClientTaxCode = EecUDField01
        ,drvSupWHBaseWgAmt = RIGHT('000000000' + REPLACE(CAST(PehSupplimentalWithholdingBaseWageAmt AS VARCHAR), '.', '') + '0000', 15) 
        ,drvYtd1Accum = RIGHT('000000000' + REPLACE(CAST(Ytd1Accumulator AS VARCHAR), '.', '') + '0000', 15)
        ,drvYtd2Accum =    CASE WHEN YTD2PrimaryAccumulator IS NULL THEN RIGHT('000000000' + REPLACE(CAST(Ytd2Accumulator AS VARCHAR), '.', '') + '0000', 15) 
                            ELSE RIGHT('000000000' + REPLACE(CAST(YTD2PrimaryAccumulator AS VARCHAR), '.', '') + '0000', 15) 
                        END
        --RIGHT('000000000' + REPLACE(CAST(Ytd2Accumulator AS VARCHAR), '.', '') + '0000', 15)
        --CASE WHEN LocCode = 'BETH' THEN
                            --    RIGHT('000000000' + REPLACE(CAST((SELECT SUM(PthCurTaxableWages) as Ytd3Accumulator FROM dbo.PTaxHist WITH (NOLOCK) JOIN dbo.TaxCode WITH (NOLOCK) ON PthTaxCode = CtcTaxCode WHERE LEFT(PthPerControl,4) = LEFT(@EndPerControl,4) AND PthPerControl <= @EndPerControl AND PthTaxCode = 'DCSIT' AND PthEEID = xEEID GROUP BY PthEEID, PthCOID) AS VARCHAR), '.', '') + '0000', 15)        
                            --ELSE 
                                --RIGHT('000000000' + REPLACE(CAST((SELECT SUM(PthCurTaxableWages) as Ytd3Accumulator FROM dbo.PTaxHist WITH (NOLOCK) JOIN dbo.TaxCode WITH (NOLOCK) ON PthTaxCode = CtcTaxCode WHERE LEFT(PthPerControl,4) = LEFT(@EndPerControl,4) AND PthPerControl <= @EndPerControl AND PthTaxCode = STateTaxCode AND PthEEID = xEEID GROUP BY PthEEID, PthCOID) AS VARCHAR), '.', '') + '0000', 15)        
                        --END
    INTO dbo.U_EFDSTKELIG_drvTbl
    FROM dbo.U_EFDSTKELIG_EEList WITH (NOLOCK)
    JOIN dbo.EmpComp WITH (NOLOCK)
        ON EecEEID = xEEID 
        AND EecCoID = xCoID
    JOIN dbo.EmpPers WITH (NOLOCK)
        ON EepEEID = xEEID
    JOIN dbo.OrgLevel WITH (NOLOCK)
        ON EecOrgLvl1 = OrgCode
--    JOIN dbo.Location WITH (NOLOCK)
--        ON EecLocation = LocCode
    JOIN (SELECT DISTINCT LocCode, LocDesc, LocAddressState, LocAddressState + 'SIT' AS StateTaxCode FROM dbo.Location WITH (NOLOCK)) AS LocationInfo
        ON EecLocation = LocCode
    JOIN dbo.U_EFDSTKELIG_PEarHist WITH (NOLOCK)
        ON PehEEID = xEEID
    JOIN dbo.U_EFDSTKELIG_YtdAccumulators WITH (NOLOCK)
        ON PthEEID = xEEID
        AND PthCOID = xCOID
    LEFT JOIN dbo.U_EFDSTKELIG_ResidentYtdTaxAccumulators WITH (NOLOCK)
        ON YpaEEID = xEEID
        AND YpaCOID = xCOID
    ;
    ---------------------------------
    -- HEADER RECORD
    ---------------------------------
    IF OBJECT_ID('U_EFDSTKELIG_Header','U') IS NOT NULL
        DROP TABLE dbo.U_EFDSTKELIG_Header;
    SELECT DISTINCT
         drvHeaderDate = GETDATE()
        ,drvHeaderTime = REPLACE(CONVERT(VARCHAR(9), GETDATE(), 108),':',SPACE(0))        
    INTO dbo.U_EFDSTKELIG_Header
    ;
    ---------------------------------
    -- TRAILER RECORD
    ---------------------------------
    IF OBJECT_ID('U_EFDSTKELIG_Trailer','U') IS NOT NULL
        DROP TABLE dbo.U_EFDSTKELIG_Trailer;
    SELECT DISTINCT
         drvTrailerDate = GETDATE()
        ,drvTrailerTime = REPLACE(CONVERT(VARCHAR(9), GETDATE(), 108),':',SPACE(0))
        ,drvRecordCount = RIGHT(REPLICATE('0', 9) + CAST((SELECT COUNT(*) FROM dbo.U_EFDSTKELIG_drvTbl) AS VARCHAR), 9)
    INTO dbo.U_EFDSTKELIG_Trailer
    ;

    --==========================================
    -- Set FileName
    --==========================================
    IF (dbo.dsi_fnVariable(@FormatCode,'UseFileName') = 'N')
    BEGIN
        UPDATE dbo.U_dsi_Parameters
            SET ExportFile = CASE WHEN dbo.dsi_fnVariable(@FormatCode,'Testing') = 'Y' THEN 'Test_Filename_' + CONVERT(VARCHAR(8),GETDATE(),112) + '.txt'
                                  WHEN @ExportCode LIKE 'OE%' THEN 'OE_Filename_' + CONVERT(VARCHAR(8),GETDATE(),112) + '.txt'
                                  ELSE 'Filename_' + CONVERT(VARCHAR(8),GETDATE(),112) + '.txt'
                             END
        WHERE FormatCode = @FormatCode;
    END

END;
